import React from "react";

const Result = ({compressArray, results}) => {
    return (
        <div className="container">
            <ul className="results"> 
                {compressArray(results).map((item, index) =>  <li key={index}> {item.value} </li>)}
            </ul>
        </div>
    )
}

export default Result;
